-- Users table with additional column for signup date
CREATE TABLE IF NOT EXISTS users (
  id SERIAL PRIMARY KEY,
  name VARCHAR(100),
  email VARCHAR(100) UNIQUE NOT NULL,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

-- Orders table with extended columns for order details
CREATE TABLE IF NOT EXISTS orders (
  id SERIAL PRIMARY KEY,
  user_id INTEGER REFERENCES users(id),
  order_date TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  purchased_item VARCHAR(100),
  order_status VARCHAR(50),
  time_of_purchase TIMESTAMP
);

-- Bills table with detailed billing info
CREATE TABLE IF NOT EXISTS bills (
  id SERIAL PRIMARY KEY,
  order_id INTEGER REFERENCES orders(id),
  invoice_number VARCHAR(50),
  invoice_amount DECIMAL(10,2),
  bill_paid VARCHAR(10),
  billing_period VARCHAR(50),
  tax DECIMAL(10,2)
);


